import React from 'react';
// import logo from './logo.svg';
import './styles/App.css'
import Header from './components/Header/Header'
import Wrapper from './components/Wrapper/Wrapper'

function App() {
  return (
   <div className="App">
     <Wrapper>
       <Header></Header>
     </Wrapper>
   </div>
  );
}

export default App;
